import React from 'react';
import {
  TextField,
  Card,
  CardContent,
  Typography,
  Button,
  CardActionArea
} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Navigation from '../components/Navigation';

const useStyles = makeStyles({
  card: {
    marginTop: 50,
    margin: '0 auto',
    maxWidth: 600
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between'
  },
  input: {
    marginBottom: 30
  },
  buttons: {
    width: '100%',
    display: 'flex',
    justifyContent: 'center'
  },
  title: {
    textAlign: 'center'
  }
});

const Login = () => {
  const classes = useStyles();

  return (
    <>
      <Navigation
        Title="Login"
        Links={[
          {
            title: 'Home',
            ref: '/'
          }
        ]}
      />

      <Card className={classes.card}>
        <CardContent>
          <Typography className variant="h4" gutterBottom>
            Account
          </Typography>
        </CardContent>
        <CardContent>
          <form className={classes.form}>
            <TextField
              className={classes.input}
              id="outlined-basic"
              label="Email"
              variant="outlined"
            />
            <TextField
              className={classes.input}
              id="outlined-basic"
              label="Password"
              variant="outlined"
            />
          </form>
          <div className={classes.buttons}>
            <Button>Login</Button>
          </div>
        </CardContent>
      </Card>
    </>
  );
};

export default Login;
